import logo from './logo.svg';
import './App.css';
import Header from './Components/Header.js';
import Footer from './Components/footer'
function App() {
  return (
    <div className="App">
      <Header info="this is my message" />
      <p>main content</p>
      <Footer />
    </div>
  );
}

export default App;
